  
CREATE TYPE APP_STATUS AS ENUM (
  'pending approval', 'approved', 'rejected'
);
CREATE TYPE SEX AS ENUM ('male', 'female', 'unknown');
CREATE TABLE Applicant (
  applicant_id SERIAL, 
  zip TEXT NOT NULL, 
  state VARCHAR(2) NOT NULL, 
  city TEXT NOT NULL, 
  street TEXT NOT NULL, 
  phone_number TEXT NOT NULL, 
  email TEXT UNIQUE NOT NULL, 
  last_name TEXT NOT NULL, 
  first_name TEXT NOT NULL, 
  PRIMARY KEY(applicant_id)
);
CREATE TABLE Application(
  application_number SERIAL, 
  date DATE NOT NULL, 
  state APP_STATUS NOT NULL, 
  co_applicant_last_name TEXT, 
  co_applicant_first_name TEXT, 
  applicant_id_fk INT NOT NULL, 
  PRIMARY KEY(application_number), 
  FOREIGN KEY (applicant_id_fk) REFERENCES Applicant (applicant_id)
);
CREATE TABLE Volunteer(
  volunteer_id SERIAL, 
  email TEXT UNIQUE NOT NULL, 
  last_name TEXT NOT NULL, 
  first_name TEXT NOT NULL, 
  cell_phone_number TEXT NOT NULL, 
  password TEXT NOT NULL, 
  start_date TIMESTAMP NOT NULL, 
  is_trusted_volunteer BOOLEAN NOT NULL,
  PRIMARY KEY(volunteer_id)
);
CREATE TABLE Dog(
  dog_id SERIAL, 
  name TEXT NOT NULL, 
  alteration_status BOOLEAN NOT NULL, 
  description TEXT NOT NULL, 
  date_of_birth DATE NOT NULL, 
  sex SEX NOT NULL, 
  microchip_id TEXT UNIQUE, 
  surrender_date DATE NOT NULL, 
  surrender_reason TEXT NOT NULL, 
  surrender_was_by_animal_control BOOLEAN NOT NULL, 
  volunteer_id_fk INT,
  FOREIGN KEY (volunteer_id_fk) REFERENCES Volunteer (volunteer_id),
  PRIMARY KEY(dog_id)
);
CREATE TABLE Breed(
  breed_id SERIAL, 
  breed TEXT UNIQUE NOT NULL,
  PRIMARY KEY(breed_id)
);

CREATE TABLE DogBreed(
  dog_id_fk INT,
  breed_id_fk INT,
  FOREIGN KEY (dog_id_fk) REFERENCES Dog (dog_id),
  FOREIGN KEY (breed_id_fk) REFERENCES Breed (breed_id),
  PRIMARY KEY (dog_id_fk, breed_id_fk)
);
CREATE TABLE Expense(
  date DATE NOT NULL, 
  vendor TEXT NOT NULL, 
  description TEXT, 
  amount_in_cents INT NOT NULL, 
  dog_id_fk INT, 
  PRIMARY KEY(dog_id_fk, date, vendor), 
  FOREIGN KEY (dog_id_fk) REFERENCES Dog (dog_id)
);
CREATE TABLE Adoption(
  date_adopted DATE, 
  application_number_fk INT, 
  dog_id_fk INT,
  FOREIGN KEY (dog_id_fk) REFERENCES Dog (dog_id),
  FOREIGN KEY (application_number_fk) REFERENCES Application (application_number),
  PRIMARY KEY (application_number_fk, dog_id_fk)
);









